Since this is a component used in different places but don't have a scope context and are therefore isolated from itself.

## The Solution

To solve this problem, we can use React Context to create a global state for the Tooltip component. This way, we can access and update the state from any component that uses the Tooltip.

Here's how we can implement it:

1. Create a new file called `TooltipContext.js` in the `context` folder.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    if (activeTooltip === id) {
      setActiveTooltip(null);
    } else {
      setActiveTooltip(id);
    }
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component takes in `children` as a prop and sets up the state for the Tooltip component.

We use the `useState` hook to create a state variable called `activeTooltip` and a function called `setActiveTooltip` to update the state. We also create a function called `openTooltip` that takes in an `id` as a parameter. This function checks if the `id` of the Tooltip that is being opened is the same as the `activeTooltip`. If it is, it sets the `activeTooltip` to `null` to close the Tooltip. If it's not, it sets the `activeTooltip` to the `id` of the Tooltip that is being opened.

2. Wrap the entire application in the `TooltipProvider` component.

```javascript
import '../styles/globals.css';
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
