There isn't a specific Shopify API for currency conversion, but you can use Shopify's REST API to retrieve the current exchange rates for different currencies and perform the conversion yourself.

To get the exchange rates, you can make a request to the following endpoint:
```bash
GET /admin/api/2022-01/shop.json
```
The response will include a `billing_address` object, which contains an array of `currency_code` and `exchange_rate` objects for each supported currency.

Here's an example of how you can retrieve the exchange rate for a specific currency using the Shopify API and the `axios` library in Node.js:
```javascript
const axios = require('axios');

const shopifyStoreUrl = 'https://your-store-name.myshopify.com';
const apiVersion = '2022-01';
const apiKey = 'your-api-key';
const password = 'your-password';
const currencyCode = 'eur';

axios.get(`${shopifyStoreUrl}/admin/api/${apiVersion}/shop.json`, {
  auth: {
    username: apiKey,
    password: password
  }
})
.then(response => {
  const exchangeRate = response.data.billing_address.find(address => address.currency_code === currencyCode).exchange_rate;
  console.log(`The exchange rate for ${currencyCode} is ${exchangeRate}`);
})
.catch(error => {
  console.error(`Error retrieving exchange rate: ${error}`);
});
```
Once you have the exchange rate, you can perform the conversion using a library like `decimal.js` or by simply dividing the price in the base currency by the exchange rate.

Note that Shopify's exchange rates are updated daily, so you may want to cache the rates and update them periodically to avoid making unnecessary API requests.

